import { useState } from "react";
import AuthForm from "./AuthForm";

const LoginForm = () => {
    return (
        <AuthFormBlock>
            <h3>로그인</h3>
                <StyledInput 
                    autoComplete="id"
                    name="id"
                    placeholder="아이디" 
                />
                <StyledInput 
                    autoComplete="new-password" 
                    name="password" 
                    placeholder="비밀번호" 
                    type="password"
                />
                <Button full>로그인</Button>
                <Footer>
                    <CustomLink to="/register">회원가입</CustomLink>
            </Footer>
        </AuthFormBlock>
    )
};

export default LoginForm;
